import React from 'react';
import { useState } from 'react/cjs/react.development';
import './index.css';
function App(){
    const [name,set]=useState();
    function Nav(){
        return (<>
            <div className='nav'>
                <h2>This is mine</h2>
            </div>
        </>);
    }
    const click = (event)=> {
        console.log(event.target.value);
        set(event.target.value);
    };
   
    return <>
        <Nav/>
        <div>
        <h1>Hello {name}</h1>
       <form>
        <input  type="text" placeholder="Enter the Name" onChange={click} value={name} required/>
        <input type="submit" placeholder='Submit'/>
       </form>
        <button className='button'>Click Me</button>
        </div>
    </>
}

export default App;
